import { Button, styled } from '@mui/material'
import React from 'react'

const SquareButton = styled(Button)({
    height: '100px',
    width: '100px',
  });

export default function Square(props) {
  return (
    <Button variant='outlined' onClick={props.onClick}>
        { props.value }
    </Button>
  )
}
